require 'set'

class Polymer
  attr_accessor :input, :removed_indexes, :size

  def initialize(input_string)
    @input = input_string
    @removed_indexes = Set.new
    @size = input.size
  end

  def solve
    last_i = 0
    i = 0

    while(true)
      break if i >= size

      previous_char = input[last_i]
      char = input[i]
      diff = (previous_char.ord - char.ord).abs

      if diff == 32
        removed_indexes.add last_i
        removed_indexes.add i
        i -= 2
      else
        i += 1
      end

      i = get_next_i(i)
      last_i = get_last_i(i-1)
    end

    input.size - removed_indexes.size
  end

  def get_last_i(i)
    return 0 if i <= 0
    return i unless removed_indexes.include?(i)
    get_last_i(i - 1)
  end

  def get_next_i(i)
    return 1 if i <= 1
    return i unless removed_indexes.include?(i)
    get_next_i(i+1)
  end

  def print(i)
    out = []
    input.each_char.with_index do |char, index|
      out << char unless removed_indexes.include?(index)
    end
    puts "#{i} - #{out.join}"
  end
end

input = DATA.read.chomp

part_1 = Polymer.new(input).solve
puts "1: #{part_1}"

